import React,{useState} from "react";

function Demo1() {
  const [count, setCount] = useState(0);

  const handleClick = () => { 
    setCount(count + 1);
  };

  return (
    <div>
      hello
      <div>
        <button onClick={handleClick} />
      </div>
    </div>
  );
}

export default Demo1;
